import './footer.css'

export default function Footer(){
    return(
        <div className='footer-container'>
            <div className='footer-parent'>
                <img 
                src={require ('../../../assets/home/shape-bg.png')} 
                alt='probleme de chargement' 
                />
            </div>
        </div>
    )
}
